function deleteFamilyColor(index) {
  var familySelected = parseInt(document.querySelector('#color-palette .color-row:not(.border-white) .family-swatches').dataset.index);
  palette.splice(index, 1);
  document.getElementById('color-palette').innerHTML = '';
  paint(palette);
  renderTexts(); // Show all curves if a unique selected color is deleted

  var hidden = hiddenDatasets(luminosityCanva.data.datasets);
  if (!hidden.includes(index) && hidden.length - palette.length === 0) showAllLines(); // Remove curves from plots

  luminosityCanva.data.datasets.splice(index, 1);
  chromaCanva.data.datasets.splice(index, 1);
  hueCanva.data.datasets.splice(index, 1);
  contrastBlackCanva.data.datasets.splice(index, 1);
  contrastWhiteCanva.data.datasets.splice(index, 1);
  contrastCanva.data.datasets.splice(index, 1);
  luminosityCanva.update();
  chromaCanva.update();
  hueCanva.update();
  contrastWhiteCanva.update();
  contrastBlackCanva.update();
  contrastCanva.update(); // In case a muted color is deleted and the new palette needs to have same status as before deletion

  luminosityCanva.data.datasets.forEach(function (colorFamily, key) {
    if (colorFamily.hidden) document.getElementById('name' + key).classList.remove('bg-yellow-300');
  });
  document.getElementById('color-palette').childNodes.forEach(function (el, key) {
    el.classList.add('border-white');
  }); // Keep selection on family after other deletion

  var newSelected = 0;

  if (index < familySelected) {
    newSelected = familySelected - 1;
    document.getElementById('shade-parent-' + newSelected).classList.remove('border-white');
  } else if (index > familySelected) {
    newSelected = familySelected;
    document.getElementById('shade-parent-' + newSelected).classList.remove('border-white');
  } else {
    newSelected = palette.length - 1;
    document.getElementById('shade-parent-' + newSelected).classList.remove('border-white');
    stopChange = true;
    pickrButton.setColor(chroma_js__WEBPACK_IMPORTED_MODULE_9___default.a.lch(palette[newSelected][5]).hex());
    stopChange = false;
  }
}

